// SupportedResources returns a sorted list of terraform resource names.
func SupportedTerraformResources() []string {
	fns := Mappers()
	list := make([]string, 0, len(fns))
	for k := range fns {
		list = append(list, k)
	}
	sort.Strings(list)
	return list
}
